export default function Diary({ id, date, emotion, content }) {
  const info = useContext(handleEditContext);
  return (
    <div className="Diary">
      <Header
        leftChild={
          <Link to="/">
            <Button type="default" text="< 뒤로가기" />
          </Link>
        }
        headText={`${date} 기록`}
        rightChild={<Button type="default" text="수정하기" />}
      />
    </div>
  );
}
